body {
    background-image: url(https://i.imgur.com/dhnoIds.jpg);
    min-height: 100vh;
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
}

#root {
    display: auto;
    min-height: 100vh;
    grid-template-rows: min-content min-content auto min-content;
    grid-template-areas: "navigation" "header" "content" "footer";
}

#fish-image {
    outline: none;
    border: none;
    border-radius: 0;
    height: 220px;
    width: 600px;
}

#lure-image {
    outline: none;
    border: none;
    border-radius: 0;
    height: 220px;
    width: 600px;
}

#knot-image {
    outline: none;
    border: none;
    border-radius: 0;
    height: 220px;
    width: 600px;
}

.grid-container {
    display: grid;
    grid-template-columns: auto;
    grid-gap: 10px;
    padding: 10px;
    position: absolute;
    left: 25%;
    border: none;
}

.button {
    height: 220px;
    width: 600px;
    border: none;
    
}

.button:hover {
    background-color: blueviolet;
    box-shadow: 0 12px 16px 0 rgba(0,0,0,0.24),0 17px 50px 0 rgba(0,0,0,0.19);
}

.button:active {
    background-color: blueviolet;
    transform: translateY(4px);
}
#close-image{
    padding: 0 0 0 0;
    border: none;
}
